import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex flex-col justify-center items-center bg-gray-50 px-4 text-center">
      {/* üñº Hero Image */}
      <img
        src="/hero.svg" // ‚úÖ This correctly loads from /public/hero.svg
        alt="Task illustration"
        className="w-72 md:w-96 mb-8"
      />

      {/* üè∑ Title & Tagline */}
      <h1 className="text-4xl font-bold text-gray-800 mb-2">üìã Task Tracker</h1>
      <p className="text-gray-600 text-lg mb-6">Organize. Focus. Finish.</p>

      {/* ‚úÖ Feature Bullets */}
      <ul className="text-left text-gray-700 mb-6 space-y-2 max-w-sm">
        <li>‚úÖ Create and manage your daily tasks</li>
        <li>‚úÖ Mark tasks as complete</li>
        <li>‚úÖ Secure login with Google</li>
      </ul>

      {/* üöÄ CTA Button */}
      <button
        onClick={() => navigate('/dashboard')}
        className="bg-blue-600 text-white px-6 py-2 rounded hover:bg-blue-700 transition"
      >
        Go to Dashboard
      </button>
    </div>
  );
};

export default Home;
